import React from "react";
import { Component } from "react";

class Itinararies extends Component {
  constructor(props) {
    super(props)
    this.state = {"itinararies": [] }
 }

  render() {
    return ( this.state.itinararies.map(i=> <div>{i}</div>) );
  }

  componentDidMount() {
    console.log(props.params)
    fetch( "http://localhost:5000/api/tinerary/search?city={this.props.params.city}" )
      .then(response =>response.json())
      .then(data => {this.setState({"itinararies": data}); console.log(data)});
}

} /* end class itinararies */

export default Itinararies;
